327 E. 12 St. Apr 5, 70?
My dear little sister;
I wrote you a few lines on Sabbath when I suppose you were having a pretty rough time.  Hope you are about at your journey's end now.  Wonder how you feel on landing.  Sunday P.M. I felt so uneasy about you whenever the wind blew and the rain poured that I went to see our good Dr.? K had quite a long visit.  He went to see how you were getting along.  Said the see was pretty rough but you wre all safe.  You were lying down had been trying ot read but could not make much of it.

for my dear little Lis,
I, P must tell you what my little fahewis? unclear said to me the other day. She told me how her father in his sleep started up & unclear to howd? to pound the wall waking the rest of the family in a fright. Said the P heard him in my finger!! Little Darby, she is so coming & her rose bud mouth is so sweet. 
Her little brother 7 years old had unclear from when he was a baby & has always been sickly since. I not meant so bright as his unclear I have had him in unclear this winter & he has grown strong & healthy & as keen & bright as I. another think P must whisper in your love. dont tell the rest. I was fixed up so nicely on unclear that some of my friend did not know unclear. cause P looked so pretty!!!! Ive thought P was about 18 years old!!!!!!!!
